<?php

use Mockery\Exception;


/**
 * 发送请求
 * @param string $host 前缀
 * @param string $url 路径
 * @param string $method 请求方式
 * @param array $headers 请求头
 * @param string $bodys 请求内容
 * @return mixed
 */
function API_CURL($host, $url, $method, $headers, $bodys): array
{
    $curl = curl_init();
    curl_setopt($curl, CURLOPT_CUSTOMREQUEST, $method);
    curl_setopt($curl, CURLOPT_URL, $url);
    curl_setopt($curl, CURLOPT_HTTPHEADER, $headers);
    curl_setopt($curl, CURLOPT_FAILONERROR, false);
    curl_setopt($curl, CURLOPT_RETURNTRANSFER, true);
    curl_setopt($curl, CURLOPT_HEADER, false); // 禁止返回http头信息
    if (1 == strpos("$" . $host, "https://")) {
        curl_setopt($curl, CURLOPT_SSL_VERIFYPEER, false);
        curl_setopt($curl, CURLOPT_SSL_VERIFYHOST, false);
    }
    if ($method == "POST") {
        curl_setopt($curl, CURLOPT_POSTFIELDS, $bodys);
    }

    $re = curl_exec($curl);
    if (!json_decode($re))
        throw new Exception("请求失败");

    return json_decode($re, true);
}

/**
 * 银行卡四要素
 * @param string $acct_name 真实姓名
 * @param string $acct_pan 银行卡号
 * @param string $cert_id 身份证号码
 * @param string $phone_num 绑定手机号
 * @param string $cert_type 检测类型
 * @param bool $needBelongArea
 * @return array|mixed
 */
function BankInfo_API($acct_name, $acct_pan, $cert_id, $phone_num, $cert_type = '01', $needBelongArea = true): array
{
    $host    = "https://ali-bankcard4.showapi.com";
    $path    = "/bank4";
    $method  = "GET";
    $appcode = env('YUNSHICHANG_APP_CODE');
    $headers = array();
    array_push($headers, "Authorization:APPCODE " . $appcode);
    $querys = "acct_name=" . $acct_name . "&acct_pan=" . $acct_pan . "&cert_id=" . $cert_id . "&cert_type=" . $cert_type . "&needBelongArea=" . $needBelongArea . "&phone_num=" . $phone_num;
    $bodys  = "";
    $url    = $host . $path . "?" . $querys;

    return API_CURL($host, $url, $method, $headers, $bodys);
}

