/**
 * 营业执照信息
 * @param string $img_base64 base64格式证件图片
 * @return array|mixed
 */
function businessLicense_API($img_base64): array
{
    $host    = "http://yingye.market.alicloudapi.com";
    $path    = "/CreditValid";
    $method  = "POST";
    $appcode = env('YUNSHICHANG_APP_CODE');
    $headers = array();
    array_push($headers, "Authorization:APPCODE " . $appcode);
