/**
 * 百度推送
 * @param string $goodsNum 商品编号
 * @return array|mixed
 */
function pushToBaidu($goodsNum)
{
    $mjtUrl  = 'https://www.meijietu.cn';
    $token   = 'Zq9wVH3f4m20LWxK';
    $host    = 'http://data.zz.baidu.com';
    $path    = '/urls';
    $querys  = 'site=' . $mjtUrl . '&token=' . $token;
    $method  = 'POST';
    $headers = array();
    array_push($headers, "Content-Type" . ":" . "text/plain");
    $bodys = $mjtUrl . '/goods/' . $goodsNum;
    $url   = $host . $path . "?" . $querys;

    $re =  API_CURL($host, $url, $method, $headers, $bodys);
    \Illuminate\Support\Facades\Log::info('【百度推送】'.$goodsNum);
    return $re;
}